import React from 'react';
import './Courses.css';

const Courses = () => {
  return (
    <div className='Courses'>
      <h2>Courses Taken</h2>
      <h3>Computer Science (GPA 3.95):</h3>
      <ul>
        <li>151-152 Introduction to Computer Science I-II</li>
        <li>15400 Introduction to Computer Systems</li>
        <li>27100 Discrete Math</li>
        <li>27200 Theory of Algorithms</li>
        <li>23700 Introduction to Computer Graphics</li>
        <li>23500 Introduction to Database Systems</li>
        <li>31230 Fundamentals of Deep Learning (Autumn 23)</li>
      </ul>
      <h3>Math and Statistics (GPA 3.85):</h3>
      <ul>
        <li>16300 Honors Calculus I-III</li>
        <li>20500 Analysis in Rn I-III</li>
        <li>20250 Abstract Linear Algebra</li>
        <li>22400 Applied Regression Analysis</li>
        <li>25100 Probability</li>
        <li>24400 Statistical Theory and Methods I</li>
      </ul>
    </div>
  );
};

export default Courses;
